 Name: recogDataType
 DataType: method
 RandomSeed: 390
 Value: |+1
  -- determine the data type of an attribute string
  -- called by: '_inOutputChanged' = plausibilityCtrl of tables 'Input' and 'output'
  -- 'PrepTabNN', 'Start'
  param AttrStr:string->string
  			
  var stmt:string := to_str("-> boolean ",AttrStr,"; return true")
  var a1:any := executeSilent(stmt) 
  if a1 /= void and a1 
  	stmt := to_str("-> any result := ",AttrStr)
  	var a:any := executeSilent(stmt)  -- also for a NwData
  	result := getSimTalkTypename(a)
  	
  	switch result
  	case "integer","real","time","length","speed","weight","acceleration","boolean","string","money" 
  	else
  		result := "Not allowed" -- result: if NwData of type object then result is "void" or "object".
  	end
  else
  	result := "Not allowed"
  end
