 Name: OnOpen
 DataType: method
 RandomSeed: 389
 Value: |+1
  -- called by: open the wizard 
  var Dialog_elem: string
  var isSet:boolean
  
  var AppObj:object := @
  var DlgObj:object := AppObj.Dialog.GAwizard
  var GAcontrol:object := AppObj.GAOptimization
  
  if (LicenseName ~= "EMPLANT_STD") OR (LicenseName~="EMPLANT_STUDENT") 	
  	DlgObj.close(false) -- prepares the message 'The GA-Wizard is not available in your license'
  	return
  end
  
  AppObj.children.writeRow(1,0, rootfolder.Localization.getText(69),"Fitness")--"Child"
  AppObj.EvolutionTab.writeRow(1,0,rootfolder.Localization.getText(70),rootfolder.Localization.getText(71),rootfolder.Localization.getText(72))--"best","average","worst"
  AppObj.StatisticalEvaluation.translate -- write column index
  -- Computer, Number of parallel processes, Number of runs, Total simulation time, Mean running time of a simulation
  AppObj.dialog.RemoteMachines.writeRow(0,0,rootfolder.Localization.getText(136),rootfolder.Localization.getText(362),rootfolder.Localization.getText(139),rootfolder.Localization.getText(140),rootfolder.Localization.getText(141))
  
  AppObj.JobsTable.writeRow(2,0,rootfolder.Localization.getText(143),rootfolder.Localization.getText(144),rootfolder.Localization.getText(145),rootfolder.Localization.getText(146),rootfolder.Localization.getText(213),rootfolder.Localization.getText(311),rootfolder.Localization.getText(313))--_Individual","Observation","State","Simulation machine
  
  AppObj.Fitness.writeRow(1,0, rootfolder.Localization.getText(148),rootfolder.Localization.getText(149))--"Target value","Weighting"
  AppObj.FitnessCalculation.writeRow(1,0, rootfolder.Localization.getText(148),rootfolder.Localization.getText(167),rootfolder.Localization.getText(149),rootfolder.Localization.getText(169))--"Target value","Value","Weighting","Product"
  --_Intermed_   AppObj.IntermediateResults.writeRow(0,0, rootfolder.Localization.getText(150),rootfolder.Localization.getText(151))--"Individual_","Observations"
  AppObj.bestIndividuals.writeRow(0,0,rootfolder.Localization.getText(73),rootfolder.Localization.getText(126),"ID",rootfolder.Localization.getText(127)) -- after "ID" removed rootfolder.Localization.getText(128)
  AppObj.Evolution.title := rootfolder.Localization.getText(176) 
  
  if AppObj.~ = rootfolder 
  	DlgObj.label :=  rootfolder.Localization.getText(152)
  else
  	DlgObj.label := to_str(rootfolder.Localization.getText(153),"'",AppObj.rootframe.name,"'")
  end
  
  AppObj.evolution.label := rootfolder.Localization.getText(155)--"Evolution";
  
  AppObj.OffSpring.xLabel := " "
  var TranslTab:table := DlgObj.dialogElements 
  for var n:=1 to TranslTab.yDim 
  	var messageTabNo: integer := TranslTab[1,n]
  	Dialog_elem := TranslTab[0,n]
  	DlgObj.setCaption(Dialog_elem, rootfolder.Localization.getText(messageTabNo))--200 + n
  next
  if (AppObj.bestIndividuals.yDim = 0) OR (AppObj.~ = rootfolder)
  
  	DlgObj.setCaption("currGenR_com"," ")
  	DlgObj.setCaption("currFitnessR_com"," ")
  	DlgObj.setCaption("currFitnessR_com"," ")
  	DlgObj.setCaption("currIndivR_com",  " ")
  else
  	DlgObj.setCaption("currGenR_com",to_str(AppObj.currGeneration))
  	if AppObj.typeOfFitness ~= "time" 
  		var timeVar:time := AppObj.bestFitness
  		DLGobj.setCaption("currFitnessR_com", to_str(timeVar))
  	else
  		DLGobj.setCaption("currFitnessR_com", to_str(round(AppObj.bestFitness,3)))
  	end
  end
  
  -- distributed simulation
  
  isSet := AppObj.UsingRemote
  DLGobj.~.grayDistSimTab(isSet)
  
  DLGobj.setCheckBox("UseRemote", AppObj.UsingRemote)
  DLGobj.setIndex("licType", AppObj.RemoteLicTypeNo)
  DLGobj.setCheckBox("LowPrio", AppObj.RemoteLowerPrio)
  
  DLGobj.setCaption("NumGen_Inp",to_str(GAcontrol.numGenerations))
  DLGobj.setCaption("GenSize_Inp",to_str(GAcontrol.generationSize))
  if GAcontrol.direction ~= "Minimum" 
  	DLGobj.setCheckBox("Min_Op",true)
  	GAcontrol.fitnessTarget := 0
  	GAcontrol.fitnessTargetAverage := 0
  else -- maximum
  	GAcontrol.fitnessTarget        := 1e300
  	GAcontrol.fitnessTargetAverage := 1e300
  	DLGobj.setCheckBox("Max_Op",true)
  end
  DLGobj.setCaption("NumRuns_I", to_str(APPObj.NumRuns))
  
  -- Project Properties
  var t:table := ReportObject.Informations
  DLGobj.setCaption("ProjName_Inp",   t[1,1])
  --DLGobj.setCaption("ProjVersion_Inp",t[1,2]);
  DLGobj.setCaption("ProjPers_Inp",   t[1,2])
  
  DLGobj.setCaption("NumBestInd_inp", to_str(AppObj.numBestSolutions))
  
  isSet :=  AppObj.UserFitness
  DLGobj.setSensitive("FitnessMethod_but",isSet)
  DLGobj.setSensitive("FitnessMethod_Inp",isSet)
  DLGobj.setSensitive("Fitness_B", NOT isSet)
  
  DlgObj.setCheckBox("showStatisticEval_CB",showStatisticEval)
  DlgObj.open
  
  -- tab Distribution
  var RemoteList:list[string]
  RemoteList.create
  var RemoteTable:object := DLGobj.~.RemoteTable
  for var j := RemoteTable.ydim downto 1 
  	RemoteList.insert(1, to_str(RemoteTable[1,j]," (",RemoteTable[2,j],")"))
  next
  
  DlgObj.setList("RemotesList",RemoteList)
