 Name: getIndividualName
 DataType: method
 RandomSeed: 385
 Value: |+1
  -- The parameter row is the row of the DataTable 'StatisticalEvaluation'
  param row:integer -> string
  var GenSize := GAOptimization.GenerationSize
  var cGen,cInd:integer
  if row <= GenSize
  	cGen := 1
  	cInd := row
  else
  	cGen := 2 + (row-GenSize) div (2*GenSize)
  	cInd := (row-GenSize) mod (2*GenSize)
  	if cInd = 0
  		cInd := 2*GenSize
  		cGen := cGen - 1
  	end	
  end
  	
  result := to_str("Gen ",cGen," Ind ",cInd)
